import React from 'react'
import Layout from '../components/Layout'
import axios from 'axios'

import List from '@material-ui/core/List'
import Divider from '@material-ui/core/Divider'
import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
        maxWidth: 360,
        backgroundColor: theme.palette.background.paper,
    },
}))

function NoticeList(props) {
    return (
        <div className={useStyles}>
            <List component="nav">
                <li>{props.props.NTC_TITLE}</li>
                <Divider />
            </List>
        </div>
    )
}

function Index(props) {
    return (
        <Layout>
            {
                props.lists.map((list, index) => (
                    <NoticeList key={index} props={list} />
                ))
            }
        </Layout>
    )
}
Index.getInitialProps = async function () {
    const response = await axios.get('http://15.165.161.162:8086/api/web/notice/NoticeList?PAGE=1')
    return {
        lists : response.data.data[0].list
    }
}

export default Index
